(30, 1, 'tpl.task.activity.alert.1', '<h3><strong>Hi %{recipient.name},</strong></h3>\n<p> Task <a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a> updated: %{activity.description} <br> <br> %{message} <br> <br> </p><hr>\n<div>To view or respond to the task, please <a href=\"%%7Btask.staff_link%7D\"><span style=\"color:rgb(84, 141, 212)\">login</span></a> to the support system</div>\n<p> <em style=\"color:rgb(127,127,127);font-size:small\">Your friendly Customer Support System</em><br> </p><figure><lt-highlighter contenteditable=\"false\" data-lt-linked=\"1\" style=\"display: none; z-index: 1 !important;\"><lt-div spellcheck=\"false\" class=\"lt-highlighter__wrapper\" style=\"width: 0px !important; height: 21px !important; transform: none !important; transform-origin: 0px 10.5px !important; zoom: 1 !important; margin-left: -9999px !important;\"><lt-div class=\"lt-highlighter__scroll-element\" style=\"top: 0px !important; left: 0px !important; width: 0px !important; height: 21px !important;\"></lt-div></lt-div></lt-highlighter><img src=\"/systpiprclreee/file.php?key=b56944cb4722cc5cda9d1e23a3ea7fbc&expires=1679011200&signature=52b77f1424ed7d6b3c2c7cbb11d65ae89a88a14c&disposition=inline\" data-cid=\"b56944cb4722cc5cda9d1e23a3ea7fbc\" alt=\"Powered by osTicket\" width=\"126\" height=\"19\" style=\"width:126px\" data-image=\"inom90xdx9t3\"></figure>', NULL, '2023-03-16 05:00:04', NULL),
(37, 67, 'ticket.client.6smq2c7bh8vr', '<p>El candidato ID 40855 CARLOS ANTONIO MONTES ARAGÓN, se cerró con él la vacante, sin embargo, no se presentó al PDV, por lo que solicitamos su apoyo para revertir el proceso y colocarle el estatus de No se presentó al punto de venta y que la vacante se active a Solicitud publicada. <br /></p>', NULL, '2023-03-17 07:27:21', '2023-03-17 07:30:51'),
(48, 68, 'ticket.client.jkad1e6sabn8', '<p>Al intentar ingresar a la plataforma de reclutamiento con mis credenciales jerson.rosas@talent-group.mx je031286 me aparece un error por lo que no me deja acceder</p>', NULL, '2023-03-19 06:57:13', NULL),
