INSERT INTO `srcl_email_template` (`id`, `tpl_id`, `code_name`, `subject`, `body`, `notes`, `created`, `updated`) VALUES
(1, 1, 'ticket.autoresp', 'Ticket de soporte reclutamiento abierto [#%{ticket.number}]', '<h3><strong>Estimad(a) %{recipient.name.full},</strong><br /></h3> <p>Se ha creado y asignado una solicitud de soporte con el número #%{ticket.number}. Un representante de Soporte Reclutamiento se comunicará con usted lo antes posible. Puedes <a href=\"%%7Brecipient.ticket_link%7D\">ver el progreso de este Ticket en línea.</a></p> <p><br /> </p> <div style=\"color:rgb(127, 127, 127)\">Soporte PIP, <br /> %{signature} </div> <hr /> <div style=\"color:rgb(127, 127, 127);font-size:small\"><em>Si desea proporcionar comentarios o información adicional, responda a este correo electrónico o <a href=\"%%7Brecipient.ticket_link%7D\"><span style=\"color:rgb(84, 141, 212)\">inicie sesión en su cuenta</span></a> para obtener un archivo completo de sus solicitudes de soporte.</em></div>', NULL, '2023-03-08 12:14:28', '2023-03-29 23:37:58'),
(2, 1, 'ticket.autoreply', 'Re: %{ticket.subject} [#%{ticket.number}]', '<h3><strong>Estimad(a) %{recipient.name.full},</strong><br /></h3> <p>Se ha creado una solicitud de soporte y se le ha asignado un ticket <a href=\"%%7Brecipient.ticket_link%7D\">#%{ticket.number}</a> con la siguiente respuesta automática <br /> <br /> Solicitando: <strong>%{ticket.topic.name}</strong> <br />El asunto de lo solicitado es: <strong>%{ticket.subject}</strong> <br /> <br /> %{response} <br /> <br /> </p> <div style=\"color:rgb(127, 127, 127)\"><br /> %{signature}</div> <hr /> <div style=\"color:rgb(127, 127, 127);font-size:small\"><em>Esperamos que esta respuesta haya respondido suficientemente a sus preguntas. Si desea proporcionar comentarios o información adicional, responda a este correo electrónico o <a href=\"%%7Brecipient.ticket_link%7D\"><span style=\"color:rgb(84, 141, 212)\">inicie sesión en su cuenta</span></a> para obtener un archivo completo de sus solicitudes de soporte.</em></div>', NULL, '2023-03-08 12:14:28', '2023-03-29 21:43:56'),
(3, 1, 'message.autoresp', 'Confirmación de mensaje', '<h3><strong>Estimad(a) %{recipient.name.full},</strong><br /></h3> <p>Su respuesta a la solicitud de soporte en el ticket <a href=\"%%7Brecipient.ticket_link%7D\">#%{ticket.number}</a> ha sido visualizada.<br /> <br /> <br /> Soporte PIP</p> <hr /> <div style=\"color:rgb(127, 127, 127);font-size:small;text-align:center\"><em>Puedes ver el progreso de la solicitud de soporte <a href=\"%%7Brecipient.ticket_link%7D\">iniciando sesión aquí.</a></em> </div>', NULL, '2023-03-08 12:14:29', '2023-03-29 21:43:22'),
(4, 1, 'ticket.notice', '%{ticket.subject} [#%{ticket.number}]', '<h3><strong>Estimad(a) %{recipient.name.full},</strong><br /></h3> <p>Nuestro equipo de atención al cliente ha creado un ticket a tu nombre: <a href=\"%%7Brecipient.ticket_link%7D\">#%{ticket.number}</a>, con los siguientes detalles: <br /> <br />Solicitando: <strong>%{ticket.topic.name}</strong> <br />El asunto de lo solicitado es: <strong>%{ticket.subject}</strong> <br /> <br />El mensaje del ticket es el siguiente:<br /> %{message} <br /> <br /> %{response} <br /> <br /> Si es necesario, un representante se comunicará con usted lo antes posible. También puedes <a href=\"%%7Brecipient.ticket_link%7D\">ver el progreso de este ticket en línea.</a><br /> <br /> </p> <div style=\"color:rgb(127, 127, 127)\">Soporte PIP,<br /><br /></div> <hr /> <div style=\"color:rgb(127, 127, 127);font-size:small\"><em>Si desea proporcionar comentarios o información adicional, responda a este correo electrónico o <a href=\"%%7Brecipient.ticket_link%7D\"><span style=\"color:rgb(84, 141, 212)\">inicie sesión en su cuenta</span></a> para obtener un archivo completo de sus solicitudes de soporte.</em></div>', NULL, '2023-03-08 12:14:29', '2023-03-29 21:54:30'),
(5, 1, 'ticket.overlimit', 'Límite de tickets abiertos alcanzado', '<h3><strong>Estimad(a) %{ticket.name.full},</strong></h3> <p>Has alcanzado el número máximo de tickets abiertos permitidos. Para poder abrir otro ticket, uno de tus tickets pendientes debe estar cerrado. Para actualizar o agregar comentarios a un ticket abierto, simplemente <a href=\"%%7Burl%7D/tickets.php?e=%%7Bticket.email%7D\">inicie sesión en nuestro Sistema de Tickets.</a><br /> <br />Gracias,<br />Soporte PIP</p>', NULL, '2023-03-08 12:14:29', '2023-03-29 23:37:16'),
(6, 1, 'ticket.reply', 'Re: %{ticket.subject} [#%{ticket.number}]', '<h3><strong>Estimad(a) %{recipient.name.full},</strong></h3> <p>%{response} <br /> <br /> </p> <div style=\"color:rgb(127, 127, 127)\"><br /> Soporte PIP</div> <hr /> <div style=\"color:rgb(127, 127, 127);font-size:small;text-align:center\"><em>Esperamos que esta respuesta haya respondido suficientemente a sus preguntas. Si no, por favor no envíe otro correo electrónico. En su lugar, responda a este correo electrónico o <a href=\"%%7Brecipient.ticket_link%7D\" style=\"color:rgb(84, 141, 212)\">inicie sesión en su cuenta</a> para un archivo completo de todas sus solicitudes y respuestas de soporte.</em></div>', NULL, '2023-03-08 12:14:29', '2023-03-29 23:27:30'),
(7, 1, 'ticket.activity.notice', 'Re: %{ticket.subject} [#%{ticket.number}]', '<h3><strong>Estimad(a) %{recipient.name.full},</strong><br /></h3> <div><em><strong>%{poster.name}</strong></em> acaba de registrar un mensaje en un ticket en el cual participas. </div> <p><br /></p> <p>El mensaje es:</p> <p>%{message} <br /> <br /> </p> <hr /> <div style=\"color:rgb(127, 127, 127);font-size:small;text-align:center\"><em>Estás recibiendo este correo electrónico porque eres un colaborador en el Ticket <a href=\"%%7Brecipient.ticket_link%7D\" style=\"color:rgb(84, 141, 212)\">#%{ticket.number}</a>. Para participar, simplemente responda a este correo electrónico o <a href=\"%%7Brecipient.ticket_link%7D\" style=\"color:rgb(84, 141, 212)\">da clic aquí</a> para obtener un archivo completo del hilo (respuestas) del Ticket.</em> </div>', NULL, '2023-03-08 12:14:29', '2023-03-29 23:39:28'),
(8, 1, 'ticket.alert', 'Alerta de nuevo ticket', '<h2>Hola %{recipient.name},</h2> <p>Se ha creado un nuevo ticket #%{ticket.number}<br /> <br /> </p> <table><tbody><tr><td><strong>Lo reporta:</strong></td><td><strong>%{ticket.name}</strong></td></tr><tr><td><strong>Con el siguiente asunto</strong>:</td><td><strong>%{ticket.subject}</strong></td></tr></tbody></table> <p><br /></p> <p>Esto es lo que %{ticket.name} detalla:<br /> %{message} <br /> <br /> </p> <hr /> <div>Para ver o responder al ticket, por favor, <a href=\"%%7Bticket.staff_link%7D\">inicie sesión</a> en el Sistema de Tickets PIP.</div> <p><em style=\"font-size:small\">Soporte PIP</em><br /> </p>', NULL, '2023-03-08 12:14:29', '2023-03-29 23:41:58'),
(9, 1, 'message.alert', 'Alerta de mensaje nuevo', '<h3><strong>Hola %{recipient.name},</strong></h3> <p>Nuevo mensaje adjunto al ticket <a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a> de <strong>%{poster.name}:</strong></p> <p><br /> %{message} <br /> <br /> </p> <hr /> <div>Para ver o responder al ticket, por favor <a href=\"%%7Bticket.staff_link%7D\"><span style=\"color:rgb(84, 141, 212)\">inicie sesión</span></a> en el sistema de tickets de soporte.</div> <p><em style=\"color:rgb(127,127,127);font-size:small\">Soporte PIP</em><br /> </p>', NULL, '2023-03-08 12:14:30', '2023-03-29 23:35:49'),
(10, 1, 'note.alert', 'Nueva alerta de actividad interna', '<h3><strong>Hola %{recipient.name},</strong></h3> <p>El agente <strong>%{note.poster}</strong> ha registrado actividad en el ticket <a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a> <br /> <br /> Mensaje de <strong>%{note.poster}:</strong><br /> %{note.message} <br /> <br /> </p> <hr /> <p>Para ver/responder al ticket, por favor <a href=\"%%7Bticket.staff_link%7D\">inicie sesión</a> al Sistema de Tickets PIP.<br /> <br /><span style=\"font-size:small\"><em>Soporte PIP</em></span></p>', NULL, '2023-03-08 12:14:30', '2023-03-29 23:41:28'),
(11, 1, 'assigned.alert', 'Ticket asignado a ti', '<h3><strong>Hola %{assignee.name.full},</strong></h3> <p>El Ticket <a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a> te ha sido asignado por <strong>%{assigner.name.short} </strong><br /> <br /> </p> <table><tbody><tr><td><strong>Solicitado por</strong>:</td> <td><strong>%{ticket.name}</strong></td> </tr> <tr><td><strong>Con el asunto</strong>:</td> <td><strong>%{ticket.subject}</strong></td> </tr> </tbody> </table> <p><br /> %{comments} <br /> <br /> </p> <hr /> <div>Para ver/responder al ticket, por favor, <a href=\"%%7Bticket.staff_link%7D\"><span style=\"color:rgb(84, 141, 212)\">inicie sesión</span></a> en el Sistema de Tickets PIP</div> <p><span style=\"font-size:small\"><em>Soporte PIP</em></span></p>', NULL, '2023-03-08 12:14:30', '2023-03-29 23:43:14'),
(12, 1, 'transfer.alert', 'El Ticket #%{ticket.number} ha sido transferido al departamento de - %{ticket.dept.name}', '<h3>Hola %{recipient.name.full},</h3> <p>El Ticket <a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a> ha sido transferido al departamento <strong>%{ticket.dept.name} </strong>por <strong>%{staff.name.full}</strong> <br /> <br /> </p> <blockquote>%{comments} </blockquote> <hr /> <div>Para ver/responder al ticket, por favor, <a href=\"%%7Bticket.staff_link%7D\">inicie sesión</a> en el Sistema de Tickets PIP.</div> <p><em style=\"font-size:small\">Soporte PIP</em><br /> </p>', NULL, '2023-03-08 12:14:30', '2023-03-29 23:43:45'),
(13, 1, 'ticket.overdue', 'Alerta de ticket caducado', '<h3><strong>Hola %{recipient.name}</strong>,</h3> <p>El ticket, <a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a> está seriamente atrasado. <br /> <br /> Todos debemos trabajar arduamente para garantizar que todos los tickets se atiendan de manera oportuna. <br /> <br />Soporte PIP</p><hr /> <div>Para ver o responder al ticket, <a href=\"%%7Bticket.staff_link%7D\"><span style=\"color:rgb(84, 141, 212)\">inicie sesión</span></a> en el Sistema de Tickets PIP. Recibes este aviso porque el ticket se te asigna directamente a ti, a un equipo o departamento del que eres miembro.<br /> </div> ', NULL, '2023-03-08 12:14:30', '2023-03-13 03:16:56'),
(14, 1, 'task.alert', 'New Task Alert', '<h2>Hi %{recipient.name},</h2> New task <a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a> created <br /> <br /> <table><tbody><tr><td><strong>Department</strong>: </td> <td>%{task.dept.name} </td> </tr> </tbody> </table> <br /> %{task.description} <br /> <br /> <hr /> <div>To view or respond to the task, please <a href=\"%%7Btask.staff_link%7D\">login</a> to the support system</div> <em style=\"font-size:small\">Your friendly Customer Support System</em> <br /> <a href=\"https://osticket.com/\"><img width=\"126\" height=\"19\" style=\"width:126px\" alt=\"Powered By osTicket\" src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" /></a>', NULL, '2023-03-08 12:14:30', '2023-03-08 12:14:30'),
(15, 1, 'task.activity.notice', 'Re: %{task.title} [#%{task.number}]', '<h3><strong>Dear %{recipient.name.first},</strong></h3> <div><em>%{poster.name}</em> just logged a message to a task in which you participate. </div> <br /> %{message} <br /> <br /> <hr /> <div style=\"color:rgb(127, 127, 127);font-size:small;text-align:center\"><em>You\'re getting this email because you are a collaborator on task #%{task.number}. To participate, simply reply to this email.</em> </div>', NULL, '2023-03-08 12:14:31', '2023-03-08 12:14:31'),
(16, 1, 'task.activity.alert', 'Task Activity [#%{task.number}] - %{activity.title}', '<h3><strong>Hi %{recipient.name},</strong></h3> Task <a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a> updated: %{activity.description} <br /> <br /> %{message} <br /> <br /> <hr /> <div>To view or respond to the task, please <a href=\"%%7Btask.staff_link%7D\"><span style=\"color:rgb(84, 141, 212)\">login</span></a> to the support system</div> <em style=\"color:rgb(127,127,127);font-size:small\">Your friendly Customer Support System</em><br /> <img src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" alt=\"Powered by osTicket\" width=\"126\" height=\"19\" style=\"width:126px\" />', NULL, '2023-03-08 12:14:31', '2023-03-08 12:14:31'),
(17, 1, 'task.assignment.alert', 'Task Assigned to you', '<h3><strong>Hi %{assignee.name.first},</strong></h3> Task <a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a> has been assigned to you by %{assigner.name.short} <br /> <br /> %{comments} <br /> <br /> <hr /> <div>To view/respond to the task, please <a href=\"%%7Btask.staff_link%7D\"><span style=\"color:rgb(84, 141, 212)\">login</span></a> to the support system</div> <em style=\"font-size:small\">Your friendly Customer Support System</em> <br /> <img src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" alt=\"Powered by osTicket\" width=\"126\" height=\"19\" style=\"width:126px\" />', NULL, '2023-03-08 12:14:31', '2023-03-08 12:14:31'),
(18, 1, 'task.transfer.alert', 'Task #%{task.number} transfer - %{task.dept.name}', '<h3>Hi %{recipient.name},</h3> Task <a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a> has been transferred to the %{task.dept.name} department by <strong>%{staff.name.short}</strong> <br /> <br /> <blockquote>%{comments} </blockquote> <hr /> <div>To view or respond to the task, please <a href=\"%%7Btask.staff_link%7D\">login</a> to the support system. </div> <em style=\"font-size:small\">Your friendly Customer Support System</em> <br /> <a href=\"https://osticket.com/\"><img width=\"126\" height=\"19\" alt=\"Powered By osTicket\" style=\"width:126px\" src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" /></a>', NULL, '2023-03-08 12:14:31', '2023-03-08 12:14:31'),
(19, 1, 'task.overdue.alert', 'Stale Task Alert', '<h3><strong>Hi %{recipient.name}</strong>,</h3> A task, <a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a> is seriously overdue. <br /> <br /> We should all work hard to guarantee that all tasks are being addressed in a timely manner. <br /> <br /> Signed,<br /> %{task.dept.manager.name} <hr /> <div>To view or respond to the task, please <a href=\"%%7Btask.staff_link%7D\"><span style=\"color:rgb(84, 141, 212)\">login</span></a> to the support system. You\'re receiving this notice because the task is assigned directly to you or to a team or department of which you\'re a member.</div> <em style=\"font-size:small\">Your friendly <span style=\"font-size:smaller\">(although with limited patience)</span> Customer Support System</em><br /> <img src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" height=\"19\" alt=\"Powered by osTicket\" width=\"126\" style=\"width:126px\" />', NULL, '2023-03-08 12:14:31', '2023-03-08 12:14:31');
