(42, 0, 30, 0, 14, 'M', 65, 'CORDERO HERRERA GUADALUPE SARAHI', NULL, NULL, '', NULL, '<p>No me deja visualizar las vacantes de los proyectos Mars Choco y Mars Pet Region 3, ya que tengo que habilitar candidatos desde solicitudes ATC</p>', 'html', '127.0.0.1', NULL, NULL, '2023-03-22 22:19:18', '0000-00-00 00:00:00'),
(43, 42, 30, 3, 0, 'R', 576, 'Axell Sosa', NULL, NULL, '', NULL, '<p>Buenas tardes Guadalupe.<br />Me podrías ayudar a validar nuevamente en la vista \"Solicitudes-ATC\" si pueden visualizar las vacantes reportadas.<br />Quedamos atentos a tus comentarios.Saludos cordiales</p><blockquote><p>No me deja visualizar las vacantes de los proyectos Mars Choco y Mars Pet Region 3, ya que tengo que habilitar candidatos desde solicitudes ATC</p></blockquote> <p><br /></p>', 'html', '::1', NULL, '{\"to\":{\"14\":\"CORDERO HERRERA GUADALUPE SARAHI <guadalupe.cordero@talent-group.mx>\"}}', '2023-03-22 22:20:54', '0000-00-00 00:00:00'),
(44, 42, 30, 4, 0, 'R', 576, 'Anallely Linaco', NULL, NULL, '', NULL, '<p>De acuerdo Axell validamos de este lado en un momento te compartimos retro. <br />SALUDOS </p><blockquote><p><br /></p></blockquote>', 'html', '::1', NULL, '{\"to\":{\"14\":\"CORDERO HERRERA GUADALUPE SARAHI <guadalupe.cordero@talent-group.mx>\"}}', '2023-03-22 22:22:22', '0000-00-00 00:00:00'),
(45, 42, 30, 5, 0, 'R', 576, 'Griselda López', NULL, NULL, '', NULL, '<p>Buena tarde Axel, <br />No se logra visualizar. <br />Saludos. </p><blockquote><p><br /></p></blockquote>', 'html', '::1', NULL, '{\"to\":{\"14\":\"CORDERO HERRERA GUADALUPE SARAHI <guadalupe.cordero@talent-group.mx>\"}}', '2023-03-22 22:24:22', '0000-00-00 00:00:00'),
(46, 42, 30, 3, 0, 'R', 576, 'Axell Sosa', NULL, NULL, '', NULL, '<p>Buenas tardes Gris.<br />La vacante 9816 pertenece al proyecto de \"UPFIELD EMPLAYADORES R3\" en las vacantes reportadas y en los comentarios reportados, no nos mencionan esos proyectos:<br /></p><figure></figure> <p><br /></p><figure></figure> <p><br /><br />Nos podrían indicar aparte de los proyectos:<br />MarsChoco R3MarsPetCare R3<br />A que otros proyectos se requiere asignar a Guadalupe con rol ATC.<br />Quedamos atentos a sus comentarios.Saludos cordiales.</p> <p><br /></p>', 'html', '::1', NULL, '{\"to\":{\"14\":\"CORDERO HERRERA GUADALUPE SARAHI <guadalupe.cordero@talent-group.mx>\"}}', '2023-03-22 22:25:29', '0000-00-00 00:00:00'),
(47, 42, 30, 4, 0, 'R', 576, 'Anallely Linaco', NULL, NULL, '', NULL, '<p><br /></p>Hola buena tarde Axell:Como lo comentamos vía telefónica me ayudas a que Sara pueda visualizar todas las marcas de la región 3 please en un momento te subo la solicitud en GLPI. SALUDOS!! <p><br /></p>', 'html', '::1', NULL, '{\"to\":{\"14\":\"CORDERO HERRERA GUADALUPE SARAHI <guadalupe.cordero@talent-group.mx>\"}}', '2023-03-22 22:26:51', '0000-00-00 00:00:00'),
(48, 42, 30, 4, 0, 'R', 576, 'Anallely Linaco', NULL, NULL, '', NULL, '<p>Hola buenos dias Axell:<br /></p>Enterada, validamos de este lado y te compartimos retro en un momento.<br />SALUDOS!<p><br /></p>', 'html', '::1', NULL, '{\"to\":{\"14\":\"CORDERO HERRERA GUADALUPE SARAHI <guadalupe.cordero@talent-group.mx>\"}}', '2023-03-22 22:27:20', '0000-00-00 00:00:00'),
(49, 42, 30, 3, 0, 'R', 576, 'Axell Sosa', NULL, NULL, '', NULL, '<p>Buenas tardes Anallely.<br /></p> <p>Solicitamos de tu amable apoyo en proporcionarnos retro sobre esta configuración.<br />Quedamos atentos a tus comentarios.Saludos cordiales.</p>', 'html', '::1', NULL, '{\"to\":{\"14\":\"CORDERO HERRERA GUADALUPE SARAHI <guadalupe.cordero@talent-group.mx>\"}}', '2023-03-22 22:28:08', '0000-00-00 00:00:00'),
(50, 42, 30, 4, 0, 'R', 576, 'Anallely Linaco', NULL, NULL, '', NULL, '<p>Hola buena tarde Axell:Confirmo que ya es posible ver las vacantes de todas las marcas. Mil gracias por su apoyo.Saludos!!<br /></p> <p><br /></p>', 'html', '::1', NULL, '{\"to\":{\"14\":\"CORDERO HERRERA GUADALUPE SARAHI <guadalupe.cordero@talent-group.mx>\"}}', '2023-03-22 22:29:46', '0000-00-00 00:00:00'),
(51, 42, 30, 3, 0, 'R', 576, 'Axell Sosa', NULL, NULL, '', NULL, '<p>Buenas tardes Anallely.<br />Gracias por la retro, se procede al cierre del soporte.<br />Saludos cordiales.</p>', 'html', '::1', NULL, '{\"to\":{\"14\":\"CORDERO HERRERA GUADALUPE SARAHI <guadalupe.cordero@talent-group.mx>\"}}', '2023-03-22 22:31:50', '0000-00-00 00:00:00'),
